import React from 'react'
import './Headauto/Headauto.css'
// import Background from '../../public/img/logo.png'
import image from "../img/l1.webp"; 
import img from "../img/anh.png"; 

const Headauto = () => {
  return (
    <div>
        <section class="content">
            <div id="left" style={{ backgroundImage:`url(${img})`, backgroundRepeat:"no-repeat", backgroundSize:"contain"}} >
            <img src={require('../img/l1.webp')} alt=''/>
            </div>
            <div id="center">content</div>
            <div id="right" style={{ backgroundImage:`url(${image})`, backgroundRepeat:"no-repeat", backgroundSize:"contain", height:700,width:160}} >right</div>
        </section>

    </div>
  )
}

export default Headauto
